https://app.diagrams.net/-- Схема для Auth-сервиса CREATE SCHEMA auth_service;
-- Таблица пользователей CREATE TABLE auth_service.users ( id SERIAL PRIMARY KEY, username VARCHAR(255) UNIQUE, email VARCHAR(255) UNIQUE, password_hash TEXT, role_id INT, created_at TIMESTAMP, updated_at TIMESTAMP );
-- Таблица ролей CREATE TABLE auth_service.roles ( id SERIAL PRIMARY KEY, name VARCHAR(255), description TEXT );
-- Таблица сессий пользователей CREATE TABLE auth_service.user_sessions ( id SERIAL PRIMARY KEY, user_id INT REFERENCES auth_service.users(id), session_token TEXT, expires_at TIMESTAMP );

https://app.diagrams.net/-- Схема для User-сервиса CREATE SCHEMA user_service;
-- Таблица пользователей CREATE TABLE user_service.users ( id SERIAL PRIMARY KEY, first_name VARCHAR(255), last_name VARCHAR(255), phone_number VARCHAR(20), address TEXT, email VARCHAR(255) UNIQUE, profile_picture_url TEXT, created_at TIMESTAMP, updated_at TIMESTAMP );
-- Таблица предпочтений пользователя CREATE TABLE user_service.user_preferences ( id SERIAL PRIMARY KEY, user_id INT REFERENCES user_service.users(id), notification_preferences TEXT, theme VARCHAR(50), language VARCHAR(50), created_at TIMESTAMP, updated_at TIMESTAMP );

https://app.diagrams.net/-- Схема для Inventory-сервиса CREATE SCHEMA inventory_service;
-- Таблица предметов инвентаря CREATE TABLE inventory_service.items ( id SERIAL PRIMARY KEY, name VARCHAR(255), description TEXT, category_id INT REFERENCES inventory_service.categories(id), quantity INT, user_id INT REFERENCES user_service.users(id), created_at TIMESTAMP, updated_at TIMESTAMP );
-- Таблица категорий предметов CREATE TABLE inventory_service.categories ( id SERIAL PRIMARY KEY, name VARCHAR(255), description TEXT );

https://app.diagrams.net/-- Схема для Task-сервиса CREATE SCHEMA task_service;
-- Таблица задач CREATE TABLE task_service.tasks ( id SERIAL PRIMARY KEY, title VARCHAR(255), description TEXT, status VARCHAR(255), assigned_to INT REFERENCES user_service.users(id), due_date TIMESTAMP, created_at TIMESTAMP, updated_at TIMESTAMP );
-- Таблица истории изменений задач CREATE TABLE task_service.task_history ( id SERIAL PRIMARY KEY, task_id INT REFERENCES task_service.tasks(id), changed_by INT REFERENCES user_service.users(id), change_type VARCHAR(255), change_timestamp TIMESTAMP );
-- Таблица категорий задач CREATE TABLE task_service.task_categories ( id SERIAL PRIMARY KEY, name VARCHAR(255), description TEXT );

