-- Схема для Category-сервиса
CREATE SCHEMA category_service;
-- Таблица категорий задач
CREATE TABLE category_service.task_categories (
id SERIAL PRIMARY KEY,
name VARCHAR(255),
description TEXT
);
-- Таблица категорий предметов
CREATE TABLE category_service.item_categories (
id SERIAL PRIMARY KEY,
name VARCHAR(255),
description TEXT
);
